import React from "react"

class SeasonSearch extends React.Component {
  constructor() {
    super()
    this.state = {
      text: "",
    }
  }
  componentDidMount() {
    fetch("https://api.mydomain.com")
      .then(response => response.json())
      .then(data => this.setState({ data }))
  }
}

export default SeasonSearch
